import React from 'react';
import './Sidebar.css';

function Sidebar() {
  return (
    <aside className="sidebar">
      <h2>Categories</h2>
      <ul>
        <li>Movies</li>
        <li>TV Shows</li>
        <li>Books</li>
        <li>Games</li>
      </ul>
    </aside>
  );
}

export default Sidebar;
